.sr-only {
  position: absolute;
  width: 1px;
  height: 1px;
  padding: 0;
  margin: -1px;
  overflow: hidden;
  clip: rect(0, 0, 0, 0);
  border: 0;
}

.sr-only-focusable:active, .sr-only-focusable:focus {
  position: static;
  width: auto;
  height: auto;
  margin: 0;
  overflow: visible;
  clip: auto;
}

.Hero {
  background:#66beea;
  background:linear-gradient(180deg,#66beea,#1d69cc);
}

.Breakdown {
  z-index: 20;
  padding: 20vw 0 7vw;
  background:#8077f4;
  background:linear-gradient(180deg,#8077f4,#7679f4)
}

.LearnMore {
  padding-bottom:5rem;
  position:relative;
  background:#737bf4;
  background:linear-gradient(180deg,#737bf4,#9572f5)
}

.dark * {
  color: white;
}

* {
    letter-spacing: .025rem;
}

body {
    color: #47525d;
    font-family: 'Titillium Web', "Open Sans", sans-serif;
    font-weight: 300;
    font-size: 0.9375rem;
    line-height: 1.9;
}

body p {
	line-height: 1.8rem;
}

sup { 
    vertical-align: super;
    font-size: 1rem;
}

.text-center {
    text-align: center;
}

html {
    font-size: 14px;
}

.Layout--Interior main, .Layout--Static main {
    color: #47525d;
}

.Layout--Interior main p, .Layout--Static main p {
	margin-bottom: 1rem;
	font-weight: 100;
}

.Layout--Interior main button, .Layout--Static main button {
	color: #1C69EE;
}

.Layout--Interior main a, .Layout--Static main a {
	color: #0275d8;
	text-decoration: none
}

.Layout--Interior main a:hover, .Layout--Static main a:hover {
	text-decoration: underline;
}

.Layout--Interior main h1, .Layout--Static main h1 {
	font-size: 2.5rem;
}

.Layout--Interior main h4, .Layout--Static main h4 {
	font-size: 1.6rem;
}

.Layout--Interior main h5, .Layout--Static main h5 {
	font-size: 1.4rem;
	line-height: 2.1rem;
}

.Layout--Interior main h6, .Layout--Static main h6 {
	font-size: 1.2rem;
	line-height: 1.8rem;
	font-weight: 600;
}

.Layout--Interior main ul, .Layout--Static main ul {
	list-style: circle;
	margin: 2rem;
}

.Layout--Interior main ul li, .Layout--Static main ul li {
	line-height: 1.8rem;
}

.Page {
}

.Page-title {
	font-size: 1.75rem;
}

p, li {
    line-height: 1.4rem;
}

strong {
    font-weight: bold;
}

h1, h2, h3, h4, h5, h6 {
    margin-bottom: 1rem;
    z-index: 20;
    position: relative;
}

h1 {
    font-size: 4.2rem;
    line-height: 4rem;
}

h2 {
    font-size: 3.2rem;
    line-height: 4rem;
}

h3 {
    font-size: 2.2rem;
    line-height: 2rem;
}

h4 {
    font-size: 1.6rem;
    line-height: 2rem;
}

h5 {
    font-size: 1.2rem;
    line-height: 2rem;
}

img {
    max-width: 100%;
}

@media only screen and (min-width: 768px) {
    html {
        font-size: 15px;
    }
}

@media only screen and (min-width: 992px) {
    html {
        font-size: 16px;
    }
}

@media only screen and (min-width: 1200px) {
    html {
        font-size: 17px;
    }
}

